import React from "react";
import classes from "./TodoList.module.css";
import TodoForm from "./TodoForm";

const Header = () => {
  return (
    <div className={classes.body}>
      <div className={classes.container}>
        <h2>Todo List</h2>
        <TodoForm />
      </div>
    </div>
  );
};

export default Header;
